export const initialState={
    mainPosts:[{
        id:1,
        User:{
            id:1,
            nickname:'dntjr9214'
        },
        content:'첫 번쨰 게시글 #헤시태그 #익스프레스',
    }],
}

const reducer = (state=initialState,action)=>{
    switch(action.type){
        default :
            return state;
    }
}

export default reducer;
